import React from 'react';

class App extends React.Component {
    constructor() {
        super();
        this.state = {
            name: 'James Bond'
        }
    }
    render() {
        return (
            <div>
                <h1>{this.state.name}</h1>
                <button onClick={() => {alert('ahooo')}}>Change Name</button>
            </div>
        )
    }
}

export default App;
